/* Stores my bathroom code */
var code = [];
/* Keypad */
var keypad = [
	[null,null,1,null,null],
 	[null,2,3,4,null],
 	[5,6,7,8,9],
	[null,"A","B","C",null],
    [null,null,"D",null,null]
];

/* Start on 5 */
var keypadIndex = [2,0];

/* Trying to figure it out */
input.forEach(function(item) {

	var directions = item.split("");

	directions.forEach(function(direction) {
		var newIndex;
		switch(direction) {
			case "U":
				newIndex = keypadIndex[0] - 1;
				if(newIndex > -1 && keypad[newIndex][keypadIndex[1]]) keypadIndex[0] = newIndex;
			break;
			case "D":
				newIndex = keypadIndex[0] + 1;
				if(newIndex < 5 && keypad[newIndex][keypadIndex[1]]) keypadIndex[0] = newIndex;
			break;
			case "R":
				newIndex = keypadIndex[1] + 1;
				if(newIndex < 5 && keypad[keypadIndex[0]][newIndex]) keypadIndex[1] = newIndex;
			break;
			case "L":
				newIndex = keypadIndex[1] - 1;
				if(newIndex > -1 && keypad[keypadIndex[0]][newIndex]) keypadIndex[1] = newIndex;
			break;
		};

	});

	code.push(keypad[keypadIndex[0]][keypadIndex[1]]);

});

console.log(code.join(""));